import React from "react";
import "./App.css";
import "./app/bootstrap.css";
import {
  BrowserRouter as Router,
  Route,
  Link
} from "react-router-dom";

export default function BasicExample() {
  return (
    <Router>
          <Route exact path="/">
            <Home />
          </Route>
          <Route path="/about">
            <About />
          </Route>
    </Router>
  );
}

function Home() {
  return (
    <div className="main-container">
     <h6>Areca/ OSMF awareness</h6>
     <p>Creating opportunities for better health decisions</p>
     <a className="search" style={{fontSize: 'larger'}}><Link to="/about">DOWNLOAD HERE</Link></a>
 </div>
  );
}

function About() {
  return (<>
    <div>
      <h1 className="head">Areca nut/ OSMF awareness</h1>
    </div>
    <div class="btn-group-vertical container" style={{paddingTop: "50px"}}>
      <a style={{backgroundColor: "#ff6666"}} href="#" class="btn btn-lg active" role="button" aria-pressed="true">About</a><br></br>
      <a style={{backgroundColor: "#FFB366"}} href="#" class="btn btn-lg active" role="button" aria-pressed="true">Effects of Areca nut usage</a><br></br>
      <a style={{backgroundColor: "#97D077"}} href="#" class="btn btn-lg active" role="button" aria-pressed="true">Diagnosis of OSMF</a><br></br>
      <a style={{backgroundColor: "#2BD9FE"}} href="#" class="btn btn-lg active" role="button" aria-pressed="true">Stages and symptoms</a><br></br>
      <a style={{backgroundColor: "#3399FF"}} href="#" class="btn btn-lg active" role="button" aria-pressed="true">Treatment</a><br></br>
      <a style={{backgroundColor: "#6666FF"}} href="#" class="btn btn-lg active" role="button" aria-pressed="true">Benefits of Quitting</a><br></br>
    </div>
  </>
  );
}
